function primary_key_generator(){
    key = generateKey();
    if (!checkIfIDInTable(key)) key = primary_key_generator();
    return key;
}

function generateKey(){
    var ret = Math.round(((Math.random()*100000)/15)*Math.sin(3));
    // newTicketID lets the server file hold onto ticket id so that updates are applied to the right ticket
    newTicketID = ret;
    return ret;
}

function checkIfIDInTable(ticket_id){
    const client = new Client({
        user:config.db.user,
        host:config.db.host,
        database:config.db.database,
        password:config.db.password,
        port:config.db.port,
        ssl:config.db.ssl
    })

    client.connect()

    var rows = 0;
    var txt = 'SELECT ticket_id FROM ticket_table WHERE ticket_id = $1';
    client.query(txt, [ticket_id],(err,res)=>{

        if (err)
        {
            console.log(err);
            client.end();
            res.status(400).send(err);
        } else {
            console.log(err, res);
            console.log(res.rowCount);
            rows = res.rowCount;
            client.end();
        }
    });

    return rows == 0;
}

